// This function maps tokens to integers indexes
let tagOfToken (t:token) = 
  match t with
  | PATTERN _   -> 0 
  | PARAM _     -> 1 
  | PREDICATE _ -> 2 
  | ACTION _    -> 3 
  | STRING _    -> 4 
  | LIDENT _    -> 5 
  | UIDENT _    -> 6 
  | COMMUT      -> 7 
  | DLESS       -> 8     
  | DGREAT      -> 9 
  | RPAREN      -> 10 
  | LPAREN      -> 11 
  | QUESTION    -> 12 
  | PLUS        -> 13 
  | STAR        -> 14 
  | BAR         -> 15 
  | EQUAL       -> 16 
  | SEMICOLON   -> 17 
  | COLON       -> 18 
  | EOF         -> 19 

// This function maps integers indexes to symbolic token ids
