  match tokenIdx with
  | 0 -> TOKEN_PATTERN 
  | 1 -> TOKEN_PARAM 
  | 2 -> TOKEN_PREDICATE 
  | 3 -> TOKEN_ACTION 
  | 4 -> TOKEN_STRING 
  | 5 -> TOKEN_LIDENT 
  | 6 -> TOKEN_UIDENT 
  | 7 -> TOKEN_COMMUT 
  | 8 -> TOKEN_DLESS 
  | 9 -> TOKEN_DGREAT 
  | 10 -> TOKEN_RPAREN 
