  | 12 -> TOKEN_QUESTION 
  | 13 -> TOKEN_PLUS 
  | 14 -> TOKEN_STAR 
  | 15 -> TOKEN_BAR 
  | 16 -> TOKEN_EQUAL 
  | 17 -> TOKEN_SEMICOLON 
  | 18 -> TOKEN_COLON 
  | 19 -> TOKEN_EOF 
  | 22 -> TOKEN_end_of_input
  | 20 -> TOKEN_error
  | _ -> failwith "tokenTagToTokenId: bad token"

